import '../css/register.css'
function Register() {
    const [name, setName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setpassword] = useState("");

    return (
        <div className="registerContainer">
            <form className="registerForm">
                <header id="registerHeader">Register</header>
                <input className="registerField" type="text" placeholder="name" value ={name}/>
                <input className="registerField" type="text" placeholder="email" value ={email}/>
                <input className="registerField" type="password" placeholder=" password"/>
                <input className="registerButton" type="submit" value="Sign UP" />
            </form>     
        </div>
    );
}

export default Register;
